import{ React, useState, useEffect} from 'react';
//import StockGraph from '../stockChart';
import './home.css';
const Home = () => {
    const [data, setData] = useState([]);
    const [keyword, setKeyword] = useState("");
  
    useEffect(() => {
      // Fetch data for the Apple stock
      fetch(`https://www.alphavantage.co/query?function=TIME_SERIES_DAILY_ADJUSTED&symbol=${keyword}&apikey=${process.env.REACT_APP_ALPHA_VANTAGE_API_KEY}&length=5`)
        .then(response => response.json())
        .then(data => {
          const timeSeriesData = data['Time Series (Daily)'];
          const formattedData = Object.keys(timeSeriesData).map(date => {
            const dailyData = timeSeriesData[date];
            return {
              date,
              name: dailyData['0. name'],

              open: dailyData['1. open'],
              high: dailyData['2. high'],
              low: dailyData['3. low'],
              close: dailyData['4. close'],
              volume: dailyData['6. volume']
            };
          });
          setData(formattedData);
        })
        .catch(error => {
          console.error(error);
        });
    }, []);
    const handleKeywordChange = (event) => {
        setKeyword(event.target.value);
    };
  
    return (
      <div className='container'>
        <div className='justify-content-center d-flex'>
        <h1>Stock Market Dashboard</h1>
        <input
                    type="text"
                    value={keyword}
                    onChange={handleKeywordChange}
                    placeholder="Search by keyword"
                />
        </div>
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Open</th>
              <th>High</th>
              <th>Low</th>
              <th>Close</th>
              <th>Volume</th>
            </tr>
          </thead>
          <tbody>
            {data.map(item => (
              <tr key={item.date}>
                <td>{item.date}</td>
                <td>{item.open}</td>
                <td>{item.high}</td>
                <td>{item.low}</td>
                <td>{item.close}</td>
                <td>{item.volume}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    );
};

export default Home;
